  false,\n\t\"url\": null,\n\t\"notes\": \"Hydrochemical and other data were collected
  from bottle casts in the Sea of Okhotsk from the Protractor from 01 June 1990 to
  31 August 1997. Data were compiled as an Atlas series and include profiles of temperature,
  and percent oxygen. Data also include concentration profiles of nitrate, ammonia,
  organic nitrogen, phosphate, organic phosphorus, and silicate. Circulation patterns
  are also included.Copies of this disc is currently available via the NODC Online
  Store athttp://ols.nndc.noaa.gov/plolstore/plsql/olstore.prodspecific?prodnum=W00081-CDR-A0001.\",\n\t\"owner_org\":
